import React from 'react';
import axios from 'axios';
import { Container, Row, Col, Form} from "react-bootstrap";
import "../PopUpForm.css";



class UkraineForm extends React.Component {
  
  constructor(props) {
    super(props);
    this.state = {
      name: '',
			email: '',
      number: '',
      option: '',
      message: ''
    }
  }

  handleSubmit(e){
    e.preventDefault();
    axios({
      method: "POST", 
      url:"http://api.mbbsadmissionsinabroad.com/index.php", 
      data:  this.state
    }).then((response)=>{
      if (response.data.status === 'success') {
        alert("Message Sent."); 
        this.resetForm()
      } else if (response.data.status === 'fail') {
        alert("Message failed to send.")
      }
    })
  }

  resetForm(){
    this.setState({name: '', email: '', option: '', number: '', message: ''})
  }
  
  
  render() {
    return(
      <div>
        <Container>
          <Row>
            <Col md={6} xs={12}>
              <form id="contact-form" onSubmit={this.handleSubmit.bind(this)} method="POST">
                <div className="form-group">
                    <label htmlFor="name"><b>Name</b><span className="asterik__sym">*</span></label>
                    <input type="text" className="form-control" id="name" value={this.state.name} onChange={this.onNameChange.bind(this)} required />
                </div>
                <div className="form-group">
                    <label htmlFor="exampleInputEmail1"><b>Email</b><span className="asterik__sym">*</span></label>
                    <input type="email" className="form-control" id="email" aria-describedby="emailHelp" value={this.state.email} onChange={this.onEmailChange.bind(this)} required />
                </div>
                <div className="form-group">
                    <label htmlFor="number"><b>Phone No</b><span className="asterik__sym">*</span></label>
                    <input type="number" className="form-control" id="number" value={this.state.number} onChange={this.onNumberChange.bind(this)} required />
                </div>
                <div className="form-group">
                    <label htmlFor="option"><b>Select College</b><span className="asterik__sym">*</span></label>
                    {/*value={this.state.option} onChange={this.onOptionChange.bind(this)} */}
                    <Form.Control as="select" value={this.state.option} onChange={this.onOptionChange.bind(this)} required>
											<option value="Bogomolets National Medical University, Kyiv">Bogomolets National Medical University, Kyiv</option>
											<option value="Odessa National Medical University, Odessa">Odessa National Medical University, Odessa</option>
											<option value="Blaksea State Medical University, Mykolaiv">Blaksea State Medical University, Mykolaiv</option>
											<option value="Donetsk National Medical University, Mariupol">Donetsk National Medical University, Mariupol</option>
											<option value="Donetsk National Medical University, Kirovograd">Donetsk National Medical University, Kirovograd</option>
											<option value="Donetsk National Medical University, Chemigiv">Donetsk National Medical University, Chemigiv</option>
											<option value="Vinnytsia National Medical University, Vinnytsia">Vinnytsia National Medical University, Vinnytsia</option>
											<option value="Ivano-Frankvisk National Medical University, Ivano-Frankvisk">Ivano-Frankvisk National Medical University, Ivano-Frankvisk</option>
											<option value="Sumy State Medical University, Sumy">Sumy State Medical University, Sumy</option>
											<option value="Zaporozhye State Medical University, Zaporozhye">Zaporozhye State Medical University, Zaporozhye</option>
											<option value="Kyiv Medical University of UAFM, Kyiv">Kyiv Medical University of UAFM, Kyiv</option>
											<option value="Uzhgorod State Medical University, Uzhgorod">Uzhgorod State Medical University, Uzhgorod</option>
											<option value="Poltava State Medical University, Poltava">Poltava State Medical University, Poltava</option>
											<option value="Ternopil State Medical University, Ternopil">Ternopil State Medical University, Ternopil</option>
											<option value="Lviv National Medical University, Lviv">Lviv National Medical University, Lviv</option>
											<option value="Bukovinian State Medical University, Chernovtsy">Bukovinian State Medical University, Chernovtsy</option>
											<option value="Kharkov National Medial University, Kharkov">Kharkov National Medial University, Kharkov</option>
											<option value="V. N. Karazin Medical University, Kharkov">V. N. Karazin Medical University, Kharkov</option>
											<option value="Dnipropetrovsk State Medical University, Dnipropetrovsk">Dnipropetrovsk State Medical University, Dnipropetrovsk</option>
                    </Form.Control>
                </div>
                <div className="form-group">
                    <label htmlFor="message"><b>Message</b></label>
                    <textarea className="form-control" rows="3" id="message" value={this.state.message} onChange={this.onMessageChange.bind(this)} />
                </div>
                <button type="submit" className="btn btn-primary">Submit</button>
              </form>
            </Col>
            <Col md={6} xs={12}>
              <div className="popup__info">
                <h2>Contact Us</h2>
                <p><a href="tel:9341666667">+91 (934) 166-6667</a></p>
                <h2>Toll Free No:</h2>
                <p><a href="mailto:info@mbbsadmissionsinabroad.com">info@mbbsadmissionsinabroad.com</a></p>
                <h2>Address</h2>
                <p>404, 1st floor, 4th A Cross Rd, HRBR Layout 2nd Block, Kalyan Nagar, Bengaluru - 560043</p>
              </div>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }

  onNameChange(event) {
	  this.setState({name: event.target.value})
  }

  onEmailChange(event) {
	  this.setState({email: event.target.value})
  }

	onNumberChange(event) {
	  this.setState({number: event.target.value})
  }
  
  onOptionChange(event) {
	  this.setState({option: event.target.value})
	}
	
  onMessageChange(event) {
	  this.setState({message: event.target.value})
  }
}

export default UkraineForm;
